// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract DeterministicFactory {
    event CloneCreated(address cloneAddress);

    function createClone(address implementation, bytes32 salt) external returns (address clone) {
        bytes memory bytecode = new bytes(55);
        bytes20 impl = bytes20(implementation);

        assembly {
            let ptr := add(bytecode, 0x20) // 메모리 배열의 실제 시작 주소
            // prefix (10 bytes)
            // 안전하게 prefix를 넣기 위해 전체 32바이트 지정 (앞에 10바이트만 실제 유효)
            mstore(ptr, 0x3d602d80600a3d3981f300000000000000000000000000000000000000000000)
            mstore(add(ptr, 0x14), shl(0x60, impl)) // impl address (20 bytes) ← shift
            mstore(add(ptr, 0x28), 0x5af43d82803e903d91602b57fd5bf3) // suffix (15 bytes)
            clone := create2(0, ptr, 0x37, salt)
        }

        require(clone != address(0), "Clone deployment failed!");
        emit CloneCreated(clone);
    }

    function computeCloneAddress(address implementation, bytes32 salt) external view returns (address predicted) {
        bytes memory bytecode = new bytes(55);
        bytes20 impl = bytes20(implementation);

        assembly {
            let ptr := add(bytecode, 0x20)
            mstore(ptr, 0x3d602d80600a3d3981f3)
            mstore(add(ptr, 0x14), shl(0x60, impl))
            mstore(add(ptr, 0x28), 0x5af43d82803e903d91602b57fd5bf3)
        }

        bytes32 bytecodeHash = keccak256(bytecode);
        predicted = address(uint160(uint(keccak256(abi.encodePacked(
            bytes1(0xff),
            address(this),
            salt,
            bytecodeHash
        )))));
    }
}

